//       localStorage.setItem('registeredusers', JSON.stringify(registeredUsers));
//       localStorage.setItem("user", "true");
//       navigate("/Login");

//   }
    // } 
    const [errors, setErrors] = useState({
      emailError: "",
      passwordError: "",
    });

    const handleSignUp = () => {
      // Reset errors
      setErrors({
        emailError: "",
        passwordError: "",
      });

      let signupSuccess = true;

      // Email validation
      if (!formData.email.includes("@")) {
        setErrors((prevState) => ({
          ...prevState,
          emailError: "Invalid email address",
        }));
        signupSuccess = false;
      }

      // Password validation
      if (formData.password.length < 8) {
        setErrors((prevState) => ({
          ...prevState,
          passwordError: "Password must be at least 8 characters",
        }));
        signupSuccess = false;
      } else if (!/[A-Z]/.test(formData.password)) {
        setErrors((prevState) => ({
          ...prevState,
          passwordError: "Password must contain at least one capital letter",
        }));
        signupSuccess = false;
      } else if (!/[$&+,:;=?@#|'<>.^*()%!-]/.test(formData.password)) {
        setErrors((prevState) => ({
          ...prevState,
          passwordError: "Password must contain at least one special character",
        }));
        signupSuccess = false;
      }

      if (formData.password !== formData.confirmpassword) {
        navigate("/SignUp");
        alert("Passwords do not match!");
        signupSuccess = false;
      }


  };

  return (
    <>
    <h1>SignUp Page</h1>
    <form>
    <div>
      <label htmlFor="email">email:</label>
      <input
        type="email"
        id="email"
        name="email"
        value={formData.email}
        onChange={(e) =>
          setFormData({ ...formData, email: e.target.value })
        }
      />
    </div>
    <br />
    <div>
      <label htmlFor="password">Password:</label>
      <input
        type="password"
        id="password"
        name="password"
        value={formData.password}
        onChange={(e) =>
          setFormData({ ...formData, password: e.target.value })
        }
      />
    </div>
    <br></br>
    <div>
      <label htmlFor="confirmpassword">Confirm Password:</label>
      <input
        type="password"
        id="confirmpassword"
        name="confirmpassword"
        value={formData.confirmpassword}
        onChange={(e) =>
          setFormData({ ...formData, confirmpassword: e.target.value })
        }
      />
    </div>
    <br />
    <button type="button" onClick={handleSignUp} className="signup-button">
      SignUp
    </button>
  </form>
  <div>
  <label htmlFor="email">Email:</label>
  <input
    type="email"
    id="email"
    name="email"
    value={formData.email}
    onChange={(e) => setFormData({ ...formData, email: e.target.value })}
  />
  <span className="error-message">{errors.emailError}</span>
</div>

<div>
  <label htmlFor="password">Password:</label>
  <input
    type="password"
    id="password"
    name="password"
    value={formData.password}
    onChange={(e) => setFormData({ ...formData, password: e.target.value })}
  />
  <span className="error-message">{errors.passwordError}</span>
</div>

  </>
  )

}

